  const [state, useState] = useState({
    isLoading: true,
    isDeleted: null,
    redirect: false,
    tips: 0,
    confirmElement: null,
    item_id: (props.match.params.id) ? props.match.params.id : null
  });

  const dispatch = useDispatch();
  const items = useSelector(state => state.items.item)

  return (
    <>
      <Header />
      <div>
        Items
      </div>
    </>
  )
}
